import HeaderDown from '../../components/Header/HeaderDown'
import turkeyistanbul from '../../assets/images/turkeyistanbul.png'
import Footer from '../../components/Footer/Footer'
import FooterDown from '../../components/Footer/FooterDown'
import styled from 'styled-components'
import { Droplet } from 'react-feather'
import ReactSearchBox from 'react-search-box'

const MainWrapper = styled.div`
  padding : 24px 12px;
  display: flex;
  flex-direction: column;
  align-items: center;
  height: auto;
  background-color: ${properties.lightGrey};
  @media (max-width: 990px) {
  flex-direction: column;

}
`
const SW1 = styled.div`
  height: 38px;
  width: 100%;
  display: flex;
  flex-direction: row;
  margin: 24px 0px;
  @media (max-width: 990px) {
  flex-direction: column;
  }
`
const SW1W = styled.div`
width: 50%;
`

const SW11 = styled.div`
  height: 100%;
  width: 196px;
  background-color: white;
  /* padding: 0px 12px; */
  display: flex;
  align-items: center;
  justify-content: center;
`
const SW12 = styled.div`
  width: 196px;
  padding: 0px 12px;
`
const ButtonSign = styled.button`
  width: 100%;
  height: 38px;
  background-color: ${properties.otherBlue};
  border-radius: 5px;
  cursor: pointer;
`
const SW13 = styled.div`
  width: auto;
  margin-right: 12px;
`
const SW13B = styled.div`
  width: 270px;
  float: right;
`

const SW2 = styled.div`
  height: 200px;
  width: 100%;
  background-color: green;
`
const SW3 = styled.div`
  height: 200px;
  width: 100%;
  background-color: yellow;
`

class Attendees extends Component {
  render() {
    return (<div>
      <Header />
      <HeaderDown />
      <MainWrapper >
        <SW1>
          <SW11>
            <TextBox
              color={properties.lightGrey}
              fontSize={fSize.medium}>
              1-18 of 413 people
            </TextBox>
          </SW11>
          <SW12>
            <ButtonSign> <TextBox
              ffamily={"regular"}
              color={properties.white}
              fontSize={fSize.mSmall}>
              Filter company Type
              </TextBox></ButtonSign>
          </SW12>
          <SW13>
            <SW13B>
              <ReactSearchBox
                placeholder="Search .."
                value=""
                data={this.data}
                callback={record => console.log(record)} />
            </SW13B>
          </SW13>
        </SW1>
        <SW2>

        </SW2>
        <SW3>

        </SW3>
      </MainWrapper>
      <Footer />
      <FooterDown />
    </div >
    )
  }
}

export default Attendees
